import React from 'react';
import { Breadcrumb, BreadcrumbItem } from 'react-bootstrap';
import { Link, useLocation } from 'react-router-dom';

const Breadcrumbs = () => {
    // Get the active page from the URL
    const location = useLocation();
    const path = location.pathname;

    return (
        <Breadcrumb>
                <BreadcrumbItem className='home-nav-link'>
                    <Link to='/' className='breadcrumb'><h3>Home</h3></Link>
                </BreadcrumbItem>
                    <BreadcrumbItem href='/about' active={path === '/about' ? true : false} className="home-nav-link">
                        <h3 className='breadcrumb'>About Me</h3>
                    </BreadcrumbItem>
                    <BreadcrumbItem href='/portfolio' active={path === '/portfolio' ? true : false} className="home-nav-link">
                        <h3 className='breadcrumb'>My Work</h3>
                    </BreadcrumbItem>
                    <BreadcrumbItem href='/contact' active={path === '/contact' ? true : false} className="home-nav-link">
                        <h3 >Contact</h3>
                    </BreadcrumbItem>
        </Breadcrumb>
    )
};

export default Breadcrumbs;
